import React, { useState } from "react";
// import './game1.css'
function Game() {
    const [count, setCount] = useState(0); 
    return (               
    <>
      <div>
        You have clicked {count} times
      </div>
      <button type="button" onClick={()=>{
        setCount(() => count + 1);
      }}>
        Click
      </button>

    </>

    );
}
export default Game;
